    false,nt"url": null,nt"notes": "This report summarizes the results of the
    first Environmental Standards and Procedures (UES) inventory of endangered species
    and wildlife resources at United States Army Kwajalein Atoll (USAKA), which was
    conducted in 1996. The primary objective of the inventory was to document the presence
    and general distribution of terrestrial and marine species of concern (SOCs) and
    to record observations on the overall condition of their habitats. Terrestrial SOCs
    included certain migratory seabirds, shorebirds, and waterfowl. Important terrestrial
    habitats included Pisonia, Pemphis, and mixed broadleaf forests; salt ponds; and
    seabird and shorebird breeding and loafing sites. Marine SOCs included certain marine
    mammals, sea turtles, corals, sponges, and mollusks. Important marine habitats included
    lagoon, interislet, and seaward reef flats and slopes; reef passes; lagoon floors;
    seagrass beds; reef quarry pits; and intertidal zones.",nt"license_title":
